import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Desktop from './Desktop';
import WorkoutSummary from './Components/WorkoutSummary'; // Assuming you have a WorkoutSummary component
import './index.css';

ReactDOM.render(
  <Router>
    <Routes>
      <Route path="/" element={<Desktop />} />
      <Route path="/workout-summary" element={<WorkoutSummary workouts={[]} />} />
      {/* Add more routes as needed */}
    </Routes>
  </Router>,
  document.getElementById('root')
);
